import React from 'react';

const Sidebar = () => {
  return (
    <div className="col-md-3">
      <div className="list-group">
        <a href="#" className="list-group-item list-group-item-action active">
          Información general
        </a>
        <a href="#" className="list-group-item list-group-item-action">Inicio</a>
        <a href="#" className="list-group-item list-group-item-action">La Asociación</a>
        <a href="#" className="list-group-item list-group-item-action">Redes Sociales</a>
        <a href="#" className="list-group-item list-group-item-action">Nuestro albergue</a>
        <a href="#" className="list-group-item list-group-item-action">Profesionales colaboradores</a>
        <a href="#" className="list-group-item list-group-item-action">Contacto</a>
        <a href="#" className="list-group-item list-group-item-action">Calendario de google</a>
      </div>
    </div>
  );
};

export default Sidebar;
